- Phần thượng lưu sông ở Trung Quốc  bắt nguồn từ vùng núi Nghiễm Sơn (tỉnh Vân Nam, Trung Quốc) ở độ cao 1.500m, chảy theo hướng đông, sau đó là đông nam khi tới biên giới. Đoạn biên giới dài 16,4 km. Vào đất Việt sông đi qua cao nguyên Đồng Văn, qua các huyện Đồng Văn, Mèo Vạc thuộc địa phận tỉnh Hà Giang, và đổ vào sông Gâm tại Nà Phòng thuộc xã Lý Bôn, huyện Bảo Lâm, tỉnh Cao Bằng. 
- Sông dài 192 km, phần chảy ở Việt Nam dài 46 km. Khu vực đèo Mã Pì Lèng địa hình rất hiểm trở nhưng rất phong phú về di sản địa chất, trong đó hẻm vực Tu Sản sâu 700-800m; dài 1,7km; vách dốc khoảng 70-90 độ. Một phụ lưu là sông Nhiệm ở phía hữu ngạn, đổ vào Nho Quế tại ranh giới 3 xã Niêm Sơn (tỉnh Hà Giang), Đức Hạnh và Lý Bôn(tỉnh Cao Bằng).

- Hệ thống thủy điện trên sông Nho Quế hiện nay: 
Tại Hà Giang có Thủy điện Nho Quế với 3 bậc là: 
Nho Quế 3 công suất 110 MW, tại xã Lũng Pù, xã Sơn Vĩ, huyện Mèo Vạc, tỉnh Hà Giang, thời gian triển khai xây dựng 2007-6/2012, đã hoàn thành.
Nho Quế 2 công suất 48 MW, tại huyện Mèo Vạc, tỉnh Hà Giang, thời gian triển khai xây dựng 2012-12/2014, đã hoàn thành. Nho Quế 1 công suất 32 MW, tại huyện Đồng Văn và Mèo Vạc, tỉnh Hà Giang, thời gian triển khai xây dựng 2013-6/2015.

Tại Bảo Lâm có 2 công trình trên sông Nho Quế:
Thủy điện Bảo Lâm 3 công suất 46 MW, nằm trong khu vực xã Đức Hạnh, huyện Bảo Lâm, tỉnh Cao Bằng và xã Niêm Tòng, huyện Mèo Vạc, tỉnh Hà Giang, 2015 – 2017.
Thủy điện Bảo Lâm 3A công suất 8 MW, tại xã Đức Hạnh và Lý Bôn huyện Bảo Lâm, tỉnh Cao Bằng, 2016 – 2018
Tại Trung Quốc một đập thủy điện được xây dựng cách biên giới chừng 6 km, hồ nước nhìn thấy rõ trên Google Maps.
